from typing import List, Set, Tuple

def FindWords(board: List[List[str]], words: List[List[str]]) -> Set[Tuple[str, ...]]:
    if len(board) > 0 and len(board[0]) == 0:
        raise ValueError("If board has rows, each row must have at least one column")
    for row in board:
        if len(row) != len(board[0]):
            raise ValueError("All rows in the board must have the same number of columns")
    ROWS = len(board)
    COLS = len(board[0]) if ROWS > 0 else 0

    # Convert words to tuple for set operations and fast lookup
    word_set = set(tuple(word) for word in words)
    found = set()
    prefix_set = set()
    for word in word_set:
        for i in range(1, len(word)):
            prefix_set.add(word[:i])

    def dfs(r, c, path, visited):
        if (r < 0 or r >= ROWS or c < 0 or c >= COLS or (r, c) in visited):
            return
        path = path + (board[r][c],)
        if path not in prefix_set and path not in word_set:
            return
        if path in word_set:
            found.add(path)
        visited.add((r, c))
        for dr, dc in [(-1,0),(1,0),(0,-1),(0,1)]:
            dfs(r+dr, c+dc, path, visited)
        visited.remove((r, c))

    for r in range(ROWS):
        for c in range(COLS):
            dfs(r, c, tuple(), set())

    return found
